import React from 'react';
import logo from './logo.svg';
import './App.css';

import Word from './components/Word';
import Hangman from './components/Hangman';
import Letters from './components/Letters';

import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div class="container">
      <h2>Hangman</h2>
      <Word />
      <br />
      <Hangman />
      <Letters />
    </div>
  );
}

export default App;
